import { Link } from "react-router-dom";
import "../stylesheets/Front.scss";

const About = () => {
  return (
    <div className="about">
      <header class="about-header">
        <Link to="/" className="link">
          <span className="about-header__landing">Landing</span>
        </Link>
        <span className="about-header__ux">UX/UI designer</span>
        <Link to="/Front/" className="link">
          <span className="about-header__front">Front-end developer</span>
        </Link>
        <Link to="/About/" className="link">
          <span className="about-header__about">About me</span>
        </Link>
      </header>
    </div>
  );
};

export default About;
